import React, { useState, useContext, useEffect } from 'react';
import GridItem from "components/Grid/GridItem.js";
import GridContainer from "components/Grid/GridContainer.js";
// import Table from "components/Table/Table.js";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";
import CardBody from "components/Card/CardBody.js";
import { makeStyles } from "@material-ui/core/styles";
// import Button from '@material-ui/core/Button'
import Button from "components/CustomButtons/Button.js";
import { Link } from 'react-router-dom'
import { useSelector, useDispatch } from 'react-redux'
import { showEmployee } from 'redux/EmployeeAction'
import api from '../../lib/axios';
const styles = {
  cardCategoryWhite: {
    "&,& a,& a:hover,& a:focus": {
      color: "rgba(255,255,255,.62)",
      margin: "0",
      fontSize: "14px",
      marginTop: "0",
      marginBottom: "0",
      fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif"
    },
    "& a,& a:hover,& a:focus": {
      color: "#FFFFFF"
    }
  },
  cardTitleWhite: {
    color: "#FFFFFF",
    marginTop: "0px",
    minHeight: "auto",
    fontWeight: "300",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    marginBottom: "3px",
    display: 'inline-block',
    textDecoration: "none",
    "& small": {
      color: "#777",
      fontSize: "65%",
      fontWeight: "400",
      lineHeight: "1"
    }
  },
  table: {
    border: 0,

  },
  tableCell: {
    border: 0,
    padding: 3,
    // minWidth:'auto',
    // width:'140px'
    // maxWidth:'5%'
  },
  tableRow: {
    marginTop: 25,
    marginBottom: 5,
  },
  addBtn: {
    float: 'right',
    display: 'inline',
    border:'1px solid white',
    zIndex:'1px',
    margin:'-5px 0px'

  }
};

const useStyles = makeStyles(styles);



function EmployeeList(props) {
  const classes = useStyles();
  const [employeeData,setEmployeeData]=useState([])
  const data = useSelector(state => state)
//   console.log(data)
  const dispatch = useDispatch();

  useEffect(() => {
    // dispatch({ type:'SHOW_EMPLOYEE' })
    dispatch(showEmployee())
    const s=api.get('employees').then(res=>{
        console.log("ds",res.data.data)
        console.log("ds1",res)
        setEmployeeData(res.data.data)
    }).catch(err=>{console.log("err",err)})
    console.log("ss",s)
  }, [])

  return (
    <div>
      <GridContainer>
        <GridItem xs={12} sm={12} md={9}>
          <Card>
            {/* in cardheader we can use plain attribute */}

            <CardHeader color="primary">
              <GridContainer>
                <GridItem xs={12} sm={12} md={6}> 
                  <h4 className={classes.cardTitleWhite} style={{ display: 'inline' }}>
                    Employee Details
            </h4>
                </GridItem>
                <GridItem xs={12} sm={12} md={6}>
                  <Button className={classes.addBtn} color="transparent" component={Link} to="/admin/addEmployee">
                    Add Employee
            </Button>
                </GridItem></GridContainer>
            </CardHeader>
            <CardBody style={{minHeight:'200px'}}>
              {/* {data.fullName != "" ? */}
                <div>
                  <GridContainer spacing={2}>
                    <GridItem xs={12} sm={12} md={12}>
                      <Table>
                        <TableHead>
                          <TableRow>
                            <TableCell style={{ width: '150px' }}>Full Name:</TableCell>
                            <TableCell>BirthDate:</TableCell>
                            <TableCell>Gender:</TableCell>
                            <TableCell>Marital Status:</TableCell>
                          </TableRow>
                        </TableHead>
                        <TableBody>
                           { employeeData.map(data=>{
                                return(
                                    <TableRow>
                                        <TableCell component="th" scope="row">{data.name}</TableCell>
                                        <TableCell component="th" scope="row">{data.birthDate}</TableCell>
                                        <TableCell component="th" scope="row">{data.gender}</TableCell>
                                        <TableCell component="th" scope="row">{data.maritalStatus}</TableCell>
                                    </TableRow>
                                )
                            })
                        }
                        </TableBody>
                      </Table>

                    </GridItem>
                  </GridContainer>
                </div>
                {/* : "No Data Available"} */}

            </CardBody>
          </Card>
        </GridItem>

      </GridContainer>
    </div>
  );
}

export default EmployeeList;


